import React, { useState, useEffect } from 'react';
import List from "./List";

const server_url = 'http://localhost:11037';

function Lists(props) {
    const [userLists, setUserLists] = useState([]);
    var idcount = 0;

    const getListsRequest = async () => {
        const options = {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          }
        }
        
        const response = await fetch(server_url + '/lists', options);
    
        const res = await response.json();
    
        console.log(res);

        return (
            <div>
              {this.state.users.map((user) => (
                <User
                  name={`${user.name.first} ${user.name.last}`}
                  avatar={user.picture.thumbnail}
                  email={user.email}
                  key={user.id.value}
                />
              ))}
            </div>
        );
    }
    
    useEffect(() => {
        getListsRequest();
    }, []);

    return (
        <div>
            <h1>Lists</h1>

            <div className="item-container">
                {props.items.map((movie, index)=> (
                    <div key={++idcount} className="items">
                    <img src={movie.Poster} alt='movie' className='movie-image'></img>
                    <div className="overlay"></div>
            </div>
        ))}
      </div>

            <List items={props.movies} />
        </div>
    )
}

export default Lists;
